import React from 'react';
import {
  Container,
  TextTitle
} from './style.js';

function LandingPage() {
  return (
    <Container>
      <TextTitle>
        <span className="textshadow">Reach Us</span>
        <div/>
      </TextTitle>
    </Container>
  );
}

export default LandingPage;
